//autogenerated:yes
//nolint:revive,govet,errcheck
package matrixpilot

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_PREFLIGHT_STORAGE_ACTION(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_PREFLIGHT_STORAGE_ACTION
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_PFS_CMD_READ_ALL.MarshalText()
		require.NoError(t, err)

		var dec MAV_PREFLIGHT_STORAGE_ACTION
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_PFS_CMD_READ_ALL, dec)
	})
}
